var FechaError = 0;
function validarNo(e)
{
	tecla=(document.all) ? e.keyCode : e.which; // 2
	if(tecla==8)return true; // backspace
	if(tecla==9)return true; //tabulador
	if(tecla==35)return true; //inicio
	if(tecla==36)return true; //fin
	if(tecla==37)return true; //flecha izquierda
	if(tecla==39)return true; //flecha Derecha
	if(tecla==109)return true; // menos
	if(tecla==110)return true; // punto
	if(tecla==189)return true; // guion
	if(e.ctrlKey && tecla==86){return true}; //Ctrl v
	if(e.ctrlKey && tecla==67){return true}; //Ctrl c
	if(e.ctrlKey && tecla==88){return true}; //Ctrl x
	if(tecla>=96 && tecla<=105){return true;} //numpad
	patron=/[0-9]/;
	te=String.fromCharCode(tecla);
	return patron.test(te);
}
function validarLet(e) {
    tecla = (document.all) ? e.keyCode : e.which;
    if (tecla == 8) return true; //backspace
    if (tecla == 9) return true; //tabulador
    if (tecla == 32) return true; //space
    if (tecla == 35) return true; //inicio
    if (tecla == 36) return true; //fin
    if (tecla == 37) return true; //flecha izquierda
    if (tecla == 39) return true; //felcha Derecha
    if (tecla == 192) return true; //letra ñ
    if (e.ctrlKey && tecla == 86) { return true }; //Ctrl v
    if (e.ctrlKey && tecla == 67) { return true }; //Ctrl c
    if (e.ctrlKey && tecla == 88) { return true }; //Ctrl x
    patron = /[a-zA-Z]/;
    te = String.fromCharCode(tecla);
    return patron.test(te);
}
